import React, { useState, useEffect } from 'react';
import api from '../../utils/api';
import { FiCheckCircle, FiClock, FiFolder } from 'react-icons/fi';

const Dashboard = () => {
  const [stats, setStats] = useState({
    totalProjects: 0,
    completedTasks: 0,
    pendingTasks: 0,
    completionPercentage: 0,
  });
  const [recentActivities, setRecentActivities] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [projectsRes, tasksRes, activitiesRes] = await Promise.all([
        api.get('/projects'),
        api.get('/tasks'),
        api.get('/activities'),
      ]);

      const projects = projectsRes.data;
      const tasks = tasksRes.data;
      const activities = activitiesRes.data;

      const completedTasks = tasks.filter((t) => t.status === 'Done').length;
      const pendingTasks = tasks.filter((t) => t.status !== 'Done').length;
      const totalTasks = tasks.length;
      const completionPercentage = totalTasks > 0 ? Math.round((completedTasks / totalTasks) * 100) : 0;

      setStats({
        totalProjects: projects.length,
        completedTasks,
        pendingTasks,
        completionPercentage,
      });

      setRecentActivities(activities.slice(0, 10));
      setLoading(false);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="text-gray-500">Loading dashboard...</div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      <h1 className="text-3xl font-bold text-gray-900">Dashboard</h1>

      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <div className="bg-white p-6 rounded-xl shadow-md card-hover transition-smooth">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600 font-medium">Total Projects</p>
              <p className="text-3xl font-bold text-indigo-600 mt-2">{stats.totalProjects}</p>
            </div>
            <div className="bg-indigo-100 p-3 rounded-full">
              <FiFolder className="text-indigo-600" size={24} />
            </div>
          </div>
        </div>

        <div className="bg-white p-6 rounded-xl shadow-md card-hover transition-smooth">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600 font-medium">Completed Tasks</p>
              <p className="text-3xl font-bold text-green-600 mt-2">{stats.completedTasks}</p>
            </div>
            <div className="bg-green-100 p-3 rounded-full">
              <FiCheckCircle className="text-green-600" size={24} />
            </div>
          </div>
        </div>

        <div className="bg-white p-6 rounded-xl shadow-md card-hover transition-smooth">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600 font-medium">Pending Tasks</p>
              <p className="text-3xl font-bold text-orange-600 mt-2">{stats.pendingTasks}</p>
            </div>
            <div className="bg-orange-100 p-3 rounded-full">
              <FiClock className="text-orange-600" size={24} />
            </div>
          </div>
        </div>

        <div className="bg-white p-6 rounded-xl shadow-md card-hover transition-smooth">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-600 font-medium">Completion Rate</p>
              <p className="text-3xl font-bold text-blue-600 mt-2">{stats.completionPercentage}%</p>
            </div>
            <div className="bg-blue-100 p-3 rounded-full">
              <div className="text-blue-600 text-xl font-bold">%</div>
            </div>
          </div>
        </div>
      </div>

      {/* Recent Activities */}
      <div className="bg-white p-6 rounded-xl shadow-md">
        <h2 className="text-xl font-bold text-gray-900 mb-4">Recent Activities</h2>
        <div className="space-y-3">
          {recentActivities.length > 0 ? (
            recentActivities.map((activity) => (
              <div
                key={activity._id}
                className="flex items-start space-x-3 p-3 rounded-lg hover:bg-gray-50 transition-smooth"
              >
                <div className="bg-indigo-100 p-2 rounded-full">
                  <FiCheckCircle className="text-indigo-600" size={16} />
                </div>
                <div className="flex-1">
                  <p className="text-sm font-medium text-gray-900">{activity.action}</p>
                  <p className="text-sm text-gray-600">{activity.description}</p>
                  <p className="text-xs text-gray-400 mt-1">
                    {new Date(activity.createdAt).toLocaleString()}
                  </p>
                </div>
              </div>
            ))
          ) : (
            <p className="text-gray-500 text-center py-4">No recent activities</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
